import logo from './logo.svg';
import './App.css';

function CustomButton() {
  return (
    <button>MyButton</button>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <h1>Hello, React.js!</h1>
        <CustomButton />
      </header>
    </div>
  );
}

export default App;
